import { NavBar, NavBarButton, LoginBar, LoginBarButton } from "./styledComponent/style.js";
import Login from "./components/Login.js";

function App() {
    return (
        <div>
            <NavBar>
                <NavBarButton>HOME</NavBarButton>
                <NavBarButton>CALENDAR</NavBarButton>
                <NavBarButton>STATS</NavBarButton>
            </NavBar>
            <LoginBar>
                <LoginBarButton>LOGIN</LoginBarButton>
                <LoginBarButton>SIGN UP</LoginBarButton>
            </LoginBar>

            <Login />
            {/* <MyCalendar /> */}
        </div>
    );
}

export default App;
